import React, { useEffect, useState } from 'react';

function ViewRegistration({ setNotificationMessage }) {
  const [registrations, setRegistrations] = useState([]);

  useEffect(() => {
    const storedCompanies = JSON.parse(localStorage.getItem('companies')) || [];
    setRegistrations(storedCompanies);
  }, []);

  const handleAction = (email, status) => {
    const updatedRegistrations = registrations.map((company) =>
      company.companyEmail === email ? { ...company, status } : company
    );

    setRegistrations(updatedRegistrations);
    localStorage.setItem('companies', JSON.stringify(updatedRegistrations));
    setNotificationMessage(`Company ${status === 'approved' ? 'approved' : 'rejected'} successfully`);
    
    // Hide notification after 3 seconds
    setTimeout(() => setNotificationMessage(''), 3000);
  };

  return (
    <div style={{ padding: '30px' }}>
      <h2>Company Registration Requests</h2>
      {registrations.length === 0 ? (
        <p>No company registrations found.</p>
      ) : (
        registrations.map((company, index) => (
          <div
            key={index}
            style={{
              border: '1px solid #ccc',
              borderRadius: '10px',
              padding: '20px',
              marginBottom: '20px',
              boxShadow: '0 2px 5px rgba(0,0,0,0.1)',
            }}
          >
            <p><strong>Company Name:</strong> {company.companyName}</p>
            <p><strong>Email:</strong> {company.companyEmail}</p>
            <p><strong>Phone:</strong> {company.companyPhone}</p>
            <p><strong>Location:</strong> {company.companyLocation}</p>

            {company.logo && (
              <div style={{ marginTop: '10px' }}>
                <p><strong>Logo:</strong></p>
                <img
                  src={company.logo}
                  alt="Company Logo"
                  style={{ width: '150px', height: 'auto', borderRadius: '8px' }}
                />
              </div>
            )}

            {company.document && (
              <div style={{ marginTop: '10px' }}>
                <p><strong>Document:</strong></p>
                <a
                  href={company.document}
                  target="_blank"
                  rel="noopener noreferrer"
                  style={{ color: '#007BFF', textDecoration: 'underline' }}
                >
                  View Document
                </a>
              </div>
            )}

            <div style={{ marginTop: '15px' }}>
              <p><strong>Status:</strong> {company.status || 'pending'}</p>
              {company.status !== 'approved' && company.status !== 'rejected' && (
                <div style={{ display: 'flex', gap: '10px', marginTop: '10px' }}>
                  <button
                    onClick={() => handleAction(company.companyEmail, 'approved')}
                    style={{
                      backgroundColor: '#4CAF50',
                      color: 'white',
                      padding: '8px 16px',
                      border: 'none',
                      borderRadius: '5px',
                      cursor: 'pointer',
                    }}
                  >
                    Approve
                  </button>
                  <button
                    onClick={() => handleAction(company.companyEmail, 'rejected')}
                    style={{
                      backgroundColor: '#f44336',
                      color: 'white',
                      padding: '8px 16px',
                      border: 'none',
                      borderRadius: '5px',
                      cursor: 'pointer',
                    }}
                  >
                    Reject
                  </button>
                </div>
              )}
            </div>
          </div>
        ))
      )}
    </div>
  );
}

export default ViewRegistration;
